    //get id in params
    const {id} = useParams();

    return (
        <Box w={'100vw'} bg={'red'} h={'100vh'} >
            <Flex align={'center'} justifyContent={'center'} alignItems={'center'} width={'300px'} maxW={'400px'} direction={'column'}>
                <Button minW={'300px'}>Start</Button>
                <Button minW={300}>Challege</Button>
            </Flex>
        </Box>
    );
};

export default GradeQuiz;
